import { Button } from "bootstrap";
import React from "react";
import { Link } from "react-router-dom";
import "./homee.css";

export default function Home() {
  return (
    <main>
      <Hero />
      <Text />
    </main>
  );
}

// hero content
const Hero = () => (
  <section className="hero">
    <div className="hero__content">
      <h1 className="hero__title">World Happiness Rankings</h1>
    </div>
  </section>
);

function Text() {
  return (
    <article className="part1">
      <div className="header1">
            <p>
                Lorem ipsum dolor sit, amet consectetur adipisicing elit. Quod eos, accusantium ab voluptatibus laborum tempora eius quis voluptatum porro minus!
            </p>
            <div className="sign-up-Now">
                <Button className="register-button">
                    Register
                </Button>
            </div>
      </div>
    </article>
  );
}
